using leetcode_sharp;

namespace UnitTests;

[TestFixture]
public class S00567Tests
{
    [Test]
    public void T1()
    {
        var sut = new S00567();
        Assert.That(sut.CheckInclusion("ab", "eidbaooo"), Is.True);
    }

    [Test]
    public void T2()
    {
        var sut = new S00567();
        Assert.That(sut.CheckInclusion("ab", "eidboaoo"), Is.False);
    }

    [Test]
    public void T3()
    {
        var sut = new S00567();
        Assert.That(sut.CheckInclusion("a", "ab"), Is.True);
    }

    [Test]
    public void T4()
    {
        var sut = new S00567();
        Assert.That(sut.CheckInclusion("adc", "dcda"), Is.True);
    }

    [Test]
    public void T5()
    {
        var sut = new S00567();
        Assert.That(sut.CheckInclusion("", ""), Is.True);
    }

    [Test]
    public void T6()
    {
        var sut = new S00567();
        Assert.That(sut.CheckInclusion("ab", "a"), Is.False);
    }
}
